import React, { useEffect, useState } from "react";
import { MapContainer, TileLayer } from "react-leaflet";
import { getTileUrl } from "./api";
import "leaflet/dist/leaflet.css";
import "./styles.css";

const MapComponent = () => {
    const [tileUrl, setTileUrl] = useState(null);

    useEffect(() => {
        getTileUrl().then(url => {
            if (url) setTileUrl(url);
        });
    }, []);

    return (
        <div className="map-container">
            <h2>Coastal Erosion Analysis</h2>
            <MapContainer center={[33.6844, 73.0479]} zoom={10} style={{ height: "500px", width: "100%" }}>
                {/* Base Layer - OpenStreetMap */}
                <TileLayer url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png" attribution="Â© OpenStreetMap contributors" />

                {/* Overlay - Sentinel-2 Image */}
                {tileUrl && (
                    <TileLayer url={tileUrl} attribution="Google Earth Engine | Sentinel-2 RGB" opacity={0.8} />
                )}
            </MapContainer>
        </div>
    );
};

export default MapComponent;
